import React, { useState } from 'react';
import { Link } from "react-router-dom";
import { Parser } from 'html-to-react'
import classNames from 'classnames';
import { SectionProps } from '../../utils/SectionProps';
import ButtonGroup from '../elements/ButtonGroup';
import Button from '../elements/Button';

const propTypes = {
  ...SectionProps.types
}

const defaultProps = {
  ...SectionProps.defaults
}

const KeywordGraph = ({
  className,
  topOuterDivider,
  bottomOuterDivider,
  topDivider,
  bottomDivider,
  hasBgColor,
  invertColor,
  ...props
}) => {

  const outerClasses = classNames(
    'keywordGraph section center-content',
    topOuterDivider && 'has-top-divider',
    bottomOuterDivider && 'has-bottom-divider',
    hasBgColor && 'has-bg-color',
    invertColor && 'invert-color',
    className
  );

  const innerClasses = classNames(
    'keywordGraph-inner section-inner',
    topDivider && 'has-top-divider',
    bottomDivider && 'has-bottom-divider'
  );

  const netHTML = "src/05_Visualization/Models/VisualAnzeights.html";

  var up = document.getElementById('Net');
  up.innerHTML = 'Click on the button to convert whole document to string';

                          function GFG_Fun() {
            var string = document.documentElement.innerHTML;
                          alert(string);
                    }


  return (
    <section
      {...props}
      className={outerClasses}
    >
      <div className="container-sm">
        <div className={innerClasses}>
          <div className="keywordGraph-content">
            <h1 className="mt-0 mb-16 reveal-from-bottom" 
            data-reveal-delay="200">
              Get started with <span className="text-color-primary">VisualAnzeights</span>
            </h1>
            <div className="container-xs">
              <p className="m-0 mb-32 reveal-from-bottom" data-reveal-delay="400">
                Link your historic data in a new way...
                </p>
              <div className="reveal-from-bottom" data-reveal-delay="600">
                <ButtonGroup>
                  <Button tag="a" color="primary" wideMobile>
                  <Link to="/workflow">
                    Upload flyer
                  </Link>
                    </Button>
                  <Button tag="a" color="dark" wideMobile href="https://github.com/joelosw/VisualAnzeights.git">
                    Start query
                    </Button>
                </ButtonGroup>
              </div>
            </div>
          </div>
                  <head>
                      <title>
                          JavaScript | Get the entire document HTML as a string.
                      </title>
                  </head>

                  <body style="text-align:center;" id="body">
                      <h1 style="color:green;">
                          GeeksforGeeks
                      </h1>
                      <p id="GFG_UP" style="font-size: 15px; font-weight: bold;">
                      </p>

                      <button onclick="GFG_Fun(); ">
                          click here
                      </button>
                      <script>

                      </script>
                  </body>


        </div>
      </div>
    </section>
  );
}

// {Parser().parse(rawHTML)}

KeywordGraph.propTypes = propTypes;
KeywordGraph.defaultProps = defaultProps;

export default KeywordGraph;
